import axios from "axios";

export async function getScreenList(){
    axios.get('http://192.168.22.99/edgeReceive/deviceList')
    .then( (response) => {
        console.log(response)
      return Promise.resolve(response)
    })
    .catch( (error) => console.log(error))
}
